export default function checkBusOff(dayOfWeek, hourMin)
{
    if(dayOfWeek != 0 && dayOfWeek != 6)
    {
        if(hourMin > 8.30 && hourMin < 17.00)
        {
            return "green";
        }
        else
        {
            return "red";
        }
    }
    else
    {
        return "red";
    }

}
